begin
	
	
	OMSP : OMSPWrapper
		generic map(
			PBUS_BASE_ADDRESS	=> X"1000"
		)
		port map(
			CLK_SYS1		=> clk_sys,
			CLK_SYS2		=> clk_sys,
			RESET			=> reset,
			OMSP_RESET		=> open,
			TICK_SYNC_IN	=> '0',
			TICK_CNT_OUT	=> open,
			NMI_IN			=> interval,
			IRQ_IN			=> "00000000000000",
			IRQ_ACC			=> open,
			PBUS_EN			=> mem_en,
			PBUS_WR			=> mem_wr,
			PBUS_WAIT		=> mem_wait,
			PBUS_ADDR		=> mem_addr,
			PBUS_DATA_IN	=> mem_din,
			PBUS_DATA_OUT	=> mem_dout,
			XBUS_EN			=> open,
			XBUS_WR			=> open,
			XBUS_ADDR		=> open,
			XBUS_DATA_IN	=> X"0000",
			XBUS_DATA_OUT	=> open,
			XDMA_EN1		=> '0',
			XDMA_EN2		=> '0',
			XDMA_WR			=> '0',
			XDMA_ADDR1		=> X"000",
			XDMA_ADDR2		=> X"000",
			XDMA_DATA_IN	=> X"00000000",
			XDMA_DATA_OUT1	=> open,
			XDMA_DATA_OUT2	=> open
		);
	
	
	
	-- (50MHz)
	CLK1_process : process begin
		clk_sys <= '1';
		wait for 10.000 ns;
		clk_sys <= '0';
		wait for 10.000 ns;
	end process;
	
	-- Interval
	Interval_process : process begin
		interval <= '0';
		wait for 10 us;
		wait until rising_edge(clk_sys);
		interval <= '1';
		wait until rising_edge(clk_sys);
	end process;
	
	
	
	
	-- 
	-- Signal_process : process begin
		
		
		
		
		
		-- wait for 500 us;
		-- assert (false) report "Simulation End" severity failure;
		-- wait;
	-- end process;
	
	-- 
	Bus_process : process begin
		-- 
		reset		<= '1';
		wait for 100 ns;
		reset		<= '0';
		wait for 100 ns;
		
		wait for 1 us;
		
		-- 
		BusWrite(CLK_SYS, mem_en, mem_wr, mem_addr, mem_din, X"1000", X"0002");
		wait for 1 us;
		for cnt in 0 to 8191 loop
			BusWrite(CLK_SYS, mem_en, mem_wr, mem_addr, mem_din, X"1001", PROM(cnt)(15 downto 8) & PROM(cnt)(7 downto 0));
		end loop;
		wait for 1 us;
		BusWrite(CLK_SYS, mem_en, mem_wr, mem_addr, mem_din, X"1000", X"0003");
		
		wait for 100 us;
		assert (false) report "Simulation End" severity failure;
		wait;
	end process;
	
end;
